CREATE TABLE students
(
    `id` integer PRIMARY KEY AUTO_INCREMENT NOT NULL,
    `imie` varchar(255) NOT NULL,
    `drugie_imie` varchar(255) NOT NULL,
    `nazwisko` varchar(255) NOT NULL,
    `imie_ojca` varchar(255) NOT NULL,
    `liczba_punktow` float NOT NULL,
    `jedna_gwiazdka` tinyint(1) NOT NULL,
    `dwie_gwiazdki` tinyint(1) NOT NULL,
    `kierunek_id` integer NOT NULL,
    `rok` integer NOT NULL,
    `created_at` datetime,
    `updated_at` datetime
);
